import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from "./serviceWorker";
import * as dataMgr from './dataMgr';
import Tabs, { TabPane } from 'rc-tabs';
import TabContent from 'rc-tabs/lib/TabContent';
import ScrollableInkTabBar from 'rc-tabs/lib/ScrollableInkTabBar';


dataMgr.regNewTool("我的世界", ()=>{
    return(
        <text id = "d"> 我的世界 </text>
    );
})


dataMgr.regNewTool("我的世界1", ()=>{
    return(
        <text id = "c"> 我的世界1 </text>
    );
})

dataMgr.regNewTool("我的世界2", ()=>{
    return(
        <text id = "b"> 我的世界2 </text>
    );
})

dataMgr.regNewTool("我的世界3", ()=>{
    return(
        <text id = "a"> 我的世界3 </text>
    );}
)

var callback = function(key){

}

class Show extends React.Component {
    constructor(props){
        super(props);
        this.state = {
          name:"input",
        }
    }
    render() {
        // var info = dataMgr.ShowInfo((x)=>{
        //     this.setState({name:x})
        // })
        // console.log("dataMgr.ShowInfo")
        return (
            <Tabs
            defaultActiveKey="2"
            onChange={callback}
            renderTabBar={()=><ScrollableInkTabBar />}
            renderTabContent={()=><TabContent />}
            >
            <TabPane tab='tab 1' key="1">first</TabPane>
            <TabPane tab='tab 2' key="2">second</TabPane>
            <TabPane tab='tab 3' key="3">third</TabPane>
            </Tabs>
        );
    }
}

ReactDOM.render(<Show/>, document.getElementById('root'))

